type_codeblock *dbg_create_codeblock(type_subband *sb)
{
	int i;
	type_codeblock *cblk;
	type_tile_comp *tile_comp;
	/* Horizontal position of the tile */
	int p;
	/* Vertical position of the tile */
	int q;
	/* Codelbock width bounded by the subband and the precinct size */
	int cblk_w;
	/* Codelbock height bounded by the subband and the precinct size */
	int cblk_h;

	cuda_h_allocate_mem((void **) &(sb->cblks), sb->num_cblks * sizeof(type_subband));

	tile_comp = sb->parent_res_lvl->parent_tile_comp;

	for (i = 0; i < sb->num_cblks; i++) {
		cblk = &(sb->cblks[i]);
		cblk->cblk_no = i;

		p = cblk->cblk_no % sb->num_xcblks;
		q = cblk->cblk_no / sb->num_xcblks;

		cblk->tlx = p * tile_comp->cblk_w;
		cblk->tly = q * tile_comp->cblk_h;

		cblk->brx = (p + 1) * tile_comp->cblk_w > sb->width ? sb->width : (p + 1) * tile_comp->cblk_w;
		cblk->bry = (q + 1) * tile_comp->cblk_h > sb->height ? sb->height : (q + 1) * tile_comp->cblk_h;

		cblk->width = cblk->brx - cblk->tlx;
		cblk->height = cblk->bry - cblk->tly;

		cblk->parent_sb = sb;
	}
}

type_subband *dbg_create_subband(type_res_lvl *res_lvl, type_subband *sb, int w, int h)
{
	cuda_h_allocate_mem((void **) &(sb), sizeof(type_subband));

	type_tile_comp *tile_comp = res_lvl->parent_tile_comp;
	type_tile *tile = tile_comp->parent_tile;

	sb->orient = 3;

	//		printf("tmp_x:%d tmp_y:%d\n", tmp_x, tmp_y);
	sb->tlx = 0;
	sb->tly = 0;
	sb->brx = w;
	sb->bry = h;

	sb->width = sb->brx - sb->tlx;
	sb->height = sb->bry - sb->tly;

	sb->num_xcblks = (sb->width + (tile_comp->cblk_w - 1)) / tile_comp->cblk_w;
	sb->num_ycblks = (sb->height + (tile_comp->cblk_h - 1)) / tile_comp->cblk_h;
	sb->num_cblks = sb->num_xcblks * sb->num_ycblks;
	//		printf("Num cblks:%d Sb w:%d Sb h:%d\n", sb->num_cblks, sb->width, sb->height);
	sb->parent_res_lvl = res_lvl;

	dbg_create_codeblock(sb);

	printf("Subband created\n");

	return sb;
}

type_res_lvl *dbg_create_res_lvl(type_tile_comp *tile_comp, type_res_lvl *res_lvl)
{
	cuda_h_allocate_mem((void **) &(res_lvl), sizeof(type_res_lvl));
	int n;
	type_tile *parent_tile = tile_comp->parent_tile;

	res_lvl->res_lvl_no = 1;
	/* Nl - (r - 1)
	 * if (r - 1 < 0) than return 0 */
	res_lvl->dec_lvl_no = tile_comp->num_dlvls - ((res_lvl->res_lvl_no - 1) < 0 ? 0 : (res_lvl->res_lvl_no - 1));

	n = 1 << (tile_comp->num_dlvls - res_lvl->res_lvl_no);
	res_lvl->tlx = (parent_tile->tlx + (n - 1)) / n;
	res_lvl->tly = (parent_tile->tly + (n - 1)) / n;

	res_lvl->brx = (parent_tile->brx + (n - 1)) / n;
	res_lvl->bry = (parent_tile->bry + (n - 1)) / n;

	res_lvl->width = res_lvl->brx - res_lvl->tlx;
	res_lvl->height = res_lvl->bry - res_lvl->tly;
	/* Set to maximum precinct size. One precinct per resolution level */
	res_lvl->prc_exp_w = 14;
	res_lvl->prc_exp_h = 14;

	//	prec_width = 1 << res_lvl->prc_exp_w;
	//	prec_height = 1 << res_lvl->prc_exp_h;
	//	res_lvl->num_vprc = (res_lvl->width + (prec_width - 1)) / prec_width;
	//	res_lvl->num_hprc = (res_lvl->height + (prec_height - 1)) / prec_height;
	//	res_lvl->num_prcs = res_lvl->num_vprc * res_lvl->num_hprc;

	println_var(INFO, "Test");

	res_lvl->num_subbands = 4;

	res_lvl->parent_tile_comp = tile_comp;

	printf("Resolution level created\n");

	return res_lvl;
}

type_tile_comp *dbg_create_tile_comp(type_tile *tile, type_tile_comp *tile_comp, int w, int h, int num_dlvls,
		int cblk_w, int cblk_h)
{
	cuda_h_allocate_mem((void **) &(tile_comp), sizeof(type_tile_comp));

	tile_comp->width = w;
	tile_comp->height = h;
	/* TODO: Hard-coded values should be as input parameters. */
	tile_comp->num_dlvls = num_dlvls;
	/* Should be num_rlvls = num_dlvls + 1, but it is redundant. */
	tile_comp->num_rlvls = tile_comp->num_dlvls;

	cuda_h_allocate_mem((void **) &(tile_comp->img_data), tile_comp->width * tile_comp->height * sizeof(type_data));
	cuda_d_allocate_mem((void **) &(tile_comp->img_data_d), tile_comp->width * tile_comp->height * sizeof(type_data));

	/* Maximum code block size is 64x64 (2^6x2^6). Should be as input parameter. */
	//	tile_comp->cblk_exp_w = 6;
	//	tile_comp->cblk_exp_h = 6;
	tile_comp->cblk_w = cblk_w;
	tile_comp->cblk_h = cblk_h;
	tile_comp->parent_tile = tile;

	printf("Tile_comp created\n");

	return tile_comp;
}

type_tile *dbg_create_tile(type_tile *tile, int w, int h)
{
	cuda_h_allocate_mem((void **) &(tile), sizeof(type_tile));

	//	printf("w:%d h:%d no_com:%d area:%d t_w:%d t_h:%d t_x:%d t_y:%d no_t:%d\n", img->width,img->height,img->num_components,img->area_alloc,img->tile_w,img->tile_h,img->num_xtiles,img->num_ytiles,img->num_tiles);

	tile->tile_no = 0;

	tile->tlx = 0;
	tile->tly = 0;

	tile->brx = w;
	tile->bry = h;

	tile->width = w;
	tile->height = h;

	printf("Tile created\n");

	return tile;

	//	tile->parent_img = img;
}

void dbg_quantization()
{
	type_tile *tile;
	type_tile_comp *tile_comp;
	type_res_lvl *res_lvl;
	type_subband *sb;
	type_codeblock *cblk;
	type_image *img;
	int *h_odata;
	int w, h;
	int s_w, s_h;
	int cblk_w, cblk_h;

	float *in_hdata;
	int i, j, x, y, p, q;

	int compression_type = 0;

	img = (type_image *)malloc(sizeof(type_image));

	if(compression_type == 0)
	{
		w = 64, h = 64;
		s_w = 64, s_h = 64;
		cblk_w = 64, cblk_h = 64;

		in_hdata = (float *)malloc(w * h * sizeof(float));

		for (j = 0; j < h; j++) {
			for (i = 0; i < w; i++) {
				if (i < s_w && j < s_h) {
					in_hdata[i + j * w] = in_shdata53[i + j * s_w];
				} else {
					in_hdata[i + j * w] = 0;
				}
				printf("%f,", in_hdata[i + j * w]);
			}
			printf("\n");
		}

		img->wavelet_type = 0;
	} else
	{
		w = 65, h = 131;
		s_w = 32, s_h = 64;
		cblk_w = 16, cblk_h = 16;

		in_hdata = (float *)malloc(w * h * sizeof(float));

		for (j = 0; j < h; j++) {
			for (i = 0; i < w; i++) {
				if (i < s_w && j < s_h) {
					in_hdata[i + j * w] = in_shdata97[i + j * s_w];
				} else {
					in_hdata[i + j * w] = 0;
				}
				printf("%f,", in_hdata[i + j * w]);
			}
			printf("\n");
		}

		img->wavelet_type = 1;
	}

	tile = dbg_create_tile(tile, w, h);
	tile->parent_img = img;
	println_var(INFO, "Tile %d %d %d %d", tile->tlx, tile->tly, tile->width, tile->height);
	tile_comp = dbg_create_tile_comp(tile, tile_comp, w, h, 1, cblk_w, cblk_h);
	res_lvl = dbg_create_res_lvl(tile_comp, res_lvl);
	sb = dbg_create_subband(res_lvl, sb, s_w, s_h);

	cuda_memcpy_htd(in_hdata, tile_comp->img_data_d, w * h * sizeof(float));
	println_var(INFO, "Test!!");
	quantization(sb);

	println_var(INFO, "Test!! ");
	println_var(INFO, "%d %d %d", sb->num_cblks, tile_comp->cblk_w, tile_comp->cblk_h);

	int o_size = sb->num_cblks * tile_comp->cblk_w * tile_comp->cblk_h * sizeof(int);
	cuda_h_allocate_mem((void **) &(h_odata), o_size);
	cuda_memcpy_dth(sb->cblks_data_d, h_odata, o_size);

	if(compression_type == 0)
	{
		for(i = 0; i < sb->num_cblks; i++)
		{
			cblk = &(sb->cblks[i]);
			p = cblk->cblk_no % sb->num_xcblks;
			q = cblk->cblk_no / sb->num_xcblks;
			for(y = 0; y < cblk->height; y++)
			{
				for(x = 0; x < cblk->width; x++)
				{
					if(o_shdata53[x + p * tile_comp->cblk_w + (y + q * tile_comp->cblk_h) * s_w] != h_odata[x+ y * tile_comp->cblk_w + cblk->cblk_no * tile_comp->cblk_w * tile_comp->cblk_h])
					{
						printf("Error: Values does not equals!");
					}
					printf("(%x,%x), ", o_shdata53[x + p * tile_comp->cblk_w + (y + q * tile_comp->cblk_h) * s_w], h_odata[x+ y * tile_comp->cblk_w + cblk->cblk_no * tile_comp->cblk_w * tile_comp->cblk_h]);
				}
			}
		}
	} else
	{
		for(i = 0; i < sb->num_cblks; i++)
		{
			cblk = &(sb->cblks[i]);
			p = cblk->cblk_no % sb->num_xcblks;
			q = cblk->cblk_no / sb->num_xcblks;
			for(y = 0; y < cblk->height; y++)
			{
				for(x = 0; x < cblk->width; x++)
				{
					if(((int)o_shdata97[x + p * tile_comp->cblk_w + (y + q * tile_comp->cblk_h) * s_w]) != h_odata[x+ y * tile_comp->cblk_w + cblk->cblk_no * tile_comp->cblk_w * tile_comp->cblk_h])
					{
						printf("Error: Values does not equals!");
					}
					printf("(%d,%d), ", o_shdata97[x + p * tile_comp->cblk_w + (y + q * tile_comp->cblk_h) * s_w], h_odata[x+ y * tile_comp->cblk_w + cblk->cblk_no * tile_comp->cblk_w * tile_comp->cblk_h]);
				}
			}
		}
	}
}
